import React from 'react';

const Adminpanel = () => {
    return (
        <div>
            <h2 style={{backgroundColor:'yellow', margin:'0'}}>DashBord</h2>
            <center><h1 style={{fontWeight:'normal'}}>Welcome  Admin Panel</h1></center>
        </div>
    );
};

export default Adminpanel;
